pair a = (-2 * Cos(70), 0);
pair b = (1, 0);
pair c = dir(30);
pair d = dir(110);
pair e = (0, 0);
draw(a--d--e--cycle);
draw(e--b--c--cycle);

// Labels
label("$A$", a, W); label("$B$", b, E);
label("$C$", c, N); label("$D$", d, N);
label("$E$", e, S); label("$70^\circ$", a, 2 * NE+ 0.5 * E);

